/**
 * 页面名_模块名_类型名
 */
const comState = {
    labelPage: (action) => {
        const {page} = action;
        return {
            default: 0,
            type: 'handleLabelPage',
            data: {
                labelPage: Number(page)
            }
        }
    }
}

export default comState;
